import React, { Component } from 'react'

export default class MainComponent extends Component {
  render() {
    return (
      <div>
        { this.props.listVideo.map((item, index) => {
                        return (
                            <p key={index.toString()}>
                                Name:  {item.name} --- Level: {item.level}
                            </p>
                        )
                    })}
        <h1> MainComponent </h1>
      </div>
    )
  }
}
